import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';



const root = ReactDOM.createRoot(document.getElementById('root'));
const under_nav = ReactDOM.createRoot(document.getElementById('under_nav'));
root.render(
  <React.StrictMode>
    <App />
    <under_nav />
  </React.StrictMode>

);
